//contains all the routing logic for the application
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Login } from "./util/login";

export const Routes = () => {
	return (
		<Router>
			<Switch>
				<Route path = "/login">
					<Login />
				</Route>

			</Switch>
		</Router>
	)
}
